import React from 'react';

import {ListGroup,Button} from 'react-bootstrap';

function authority(){
    return(
        <div>
    <ListGroup>
         <ListGroup.Item>Add</ListGroup.Item>
         <ListGroup.Item>Modify</ListGroup.Item>
         <ListGroup.Item>Delete</ListGroup.Item>
         <ListGroup.Item>View</ListGroup.Item>
         <ListGroup.Item>Clear</ListGroup.Item>{' '}
        <div classs="text-center">
         <Button variant="info" type=" save "> 
           save
         </Button>{' '}
     
         <Button variant="danger" type=" save "> 
         Delete
       </Button>{' '}
       </div>
       <Button variant="primary" type=" save "> 
       Remove Modify Right 
       </Button>{' '}

       
       <Button variant="secondary" type=" save "> 
       View All 
       </Button>{' '}
   

    </ListGroup>
    
    </div>
   
    );
}
export default authority;
